import React, {Component} from 'react';
import Components from './component'
class App extends Component{
    
    render(){
       
        return (
            <div className="mainDiv container-fluid text-center justify-content-center">
                <div className="row">
                    <div className="col-6">
                    {this.props.listOfItems}
                    </div>
                    <div className="col-6">
                    {this.props.listOfItems}
                    </div>
                </div>
            </div>
        )
    }
}

export default App;
